import React from 'react'

class Card extends React.Component{
    constructor(props){
        super(props);
        this.state={
            cardArray:[
                {
                    link: "https://www.freecodecamp.org/news/content/images/2021/06/Ekran-Resmi-2019-11-18-18.08.13.png",
                    caption: "React"

                },
                {
                    link: "https://i.guim.co.uk/img/media/a755adc8dead2440d5ac448a289c6592e176afe8/0_90_5184_3110/master/5184.jpg?width=1200&height=1200&quality=85&auto=format&fit=crop&s=3fb2bcec8ce12ed3214dcc8eccb663bc",
                    caption: "Bear"
                }
            ],
        }
    }
    render(){
        return(
        <div className='columnRight'>
            <div className='Card'>
                <img src = {cardArray.link}  width = '200px' height ='200px' alt="this is not a valid link"></img>
                <p>{cardArray.caption}</p>
                <button>x</button>
            </div>
        </div>

        )

    }
}

export default Card
